INSERT INTO npc_emotes (`id`, `emoteid`, `event_`, `type`, `text`) VALUES (4236, 261, 9, 0, "Another notch in the belts of the Nybright sisters, great bandits of the dervish cutthroats.");
INSERT INTO npc_emotes (`id`, `emoteid`, `event_`, `type`, `text`) VALUES (4237, 386, 9, 0, "Your passing proves the might of the Eldritch Collective. Let all know of our arcane prowess.");
INSERT INTO npc_emotes (`id`, `emoteid`, `event_`, `type`, `text`) VALUES (4238, 2032, 1, 0, "You will be known as a foe to all in Ak'Anon. My death will not go unnoticed!");
INSERT INTO npc_emotes (`id`, `emoteid`, `event_`, `type`, `text`) VALUES (4239, 262, 9, 0, "Please forgive me. I never wanted to be a dervish cutthroat like my sisters.");
INSERT INTO npc_emotes (`id`, `emoteid`, `event_`, `type`, `text`) VALUES (4240, 2033, 1, 0, "You have happened upon the territory of the dervish cutthroats. Now, you pay the price!");
INSERT INTO npc_emotes (`id`, `emoteid`, `event_`, `type`, `text`) VALUES (4241, 2033, 9, 0, "What were you thinking? Ha! You are no match for a dervish cutthroat!");
INSERT INTO npc_emotes (`id`, `emoteid`, `event_`, `type`, `text`) VALUES (4242, 2033, 3, 0, "Aargh! Watch your back, fool. The dervish cutthroats are everywh... Ungh...");
INSERT INTO npc_emotes (`id`, `emoteid`, `event_`, `type`, `text`) VALUES (4243, 2034, 3, 0, "Your ability is strong, may you serve Cazic Thule with all your might.");
INSERT INTO npc_emotes (`id`, `emoteid`, `event_`, `type`, `text`) VALUES (4244, 2034, 1, 0, "Good, your sense of timing is correct. Now begin! Show me that your training has not been wasted.");
INSERT INTO npc_emotes (`id`, `emoteid`, `event_`, `type`, `text`) VALUES (4245, 2035, 1, 0, "Guards!  Come smash!");
